function exp(b){var a=document.getElementById("p"+b).src;if(a.slice(a.lastIndexOf("/")+1)=="minus.gif"){collapse(b)}else{expand(b)}}function expand(id){var myDoc=top.TOC.document;with(myDoc.getElementById("s"+id)){className="x";style.display=""}myDoc.getElementById("p"+id).src="minus.gif";myDoc.getElementById("b"+id).src="obook.gif"}function collapse(id){with(document.getElementById("s"+id)){className="x";style.display="none"}document.getElementById("p"+id).src="plus.gif";document.getElementById("b"+id).src="cbook.gif"}function highlight(a){if(window.top.TOC.document.getElementById("a"+a)){window.top.TOC.document.getElementById("a"+a).focus()}}function loadTOC(){if(!isTOCLoaded()){top.TOC.location.href="toc.htm"}}function isTOCLoaded(){if(top.TOC){var b=top.TOC.location.pathname;var a=b.substr(b.length-7);if(a=="toc.htm"){return true}else{return false}}else{return false}};